import React from "react";
import "../styles.css";
import { Link } from "react-router-dom";
import { FacebookShareButton, TwitterShareButton, WhatsappIcon, WhatsappShareButton } from "react-share";
import { FacebookIcon, TwitterIcon } from "react-share";

function EnoughContent() {
    return (
        <div className="enough">
            <p className="title" id="enough-container">WHAT CAN I DO?</p>
            <ul className="bullet-points">
                <li className="bullet"> SUPPORT ISRAEL ONLINE USING HASHTAGS <span className="hashtag"> #TRUEFACEOFPALESTINE #HAMASisISIS</span ></li>
                <li className="bullet"> SHARE THIS WEBSITE TO AND SHOW THE WORLD WHO ARE HAMAS'S "FREEDOM FIGHTERS"<br/></li>
                <li><FacebookShareButton
                        url={"https://trueface.com/"}
                        quote={"Learn more about how Hamas Is Isis!"}
                        hashtag={"#TRUEFACEOFPALESTINE"}
                        className="share-button"
                    >
                        <FacebookIcon size={32} round />
                    </FacebookShareButton>
                    <TwitterShareButton
                        title={"The true face of Palestine"}
                        url={"https://trueface.com/"}
                        hashtags={["TRUEFACEOFPALESTINE", "HAMASisISIS"]}
                        className="share-button"
                    >
                        <TwitterIcon size={32} round />
                    </TwitterShareButton>
                    <WhatsappShareButton
                        title={"The true face of Palestine"}
                        url={"https://trueface.com/"}
                        className="share-button"
                    >
                        <WhatsappIcon size={32} round />
                    </WhatsappShareButton></li>
                <li className="bullet"> WATCH VIDEOS ABOUT <a href="https://www.prageru.com/video/why-isnt-there-a-palestinian-state"> THE CONFLICT </a> AND HOW PALESTINIAN LEADERSHIP ALWAYS DESTROYS THE PEACE PROCESS. </li>
                <li className="bullet"> DONATE TO THE FOLLOWING <Link to='/fundraisers'> FUNDRAISERS </Link> SUPPORTING THE SURVIVORS AND THE IDF </li>
            </ul>
            {/* <p className="bullet"> DON&apos;T FALL FOR THE RADICAL ISLAMIST PROPOGANDA. CHOOSE THE RIGHT SIDE OF HISTORY BEFORE MORE BLOOD IS SPILT. </p> */}
            <p id="enough-title">
                <span>true face <br /> of </span> palestine
            </p>
            <img src="../images/blood.png" id="blood-img" alt="blood" />
            <br />
        </div>
    );
}

const Enough = () => {
    return (
        <>
            <EnoughContent />
        </>
    );
};

export default Enough;
